import React from 'react'

class App extends React.Component {
  constructor () {
    super()
    this.state = {
      toggle: 'On'
    }
  }

  render () {
    return (
      <>
        <div>Toggle {this.state.toggle}</div>
        <button>Toggle</button>
      </>
    )
  }
}

export default App
